static void _RSClosureInvoke(RSClosureRef closure, RSTypeRef *returnValue) {
    assert(closure->_callback != nil && "closure callback is not setup!");
    if (_RSClosureHasReturnType(closure)) {
        RSTypeRef val = _RSClosureInvokeWithReturn(closure);
        if (returnValue) {
            *returnValue = val;
        }
        return;
    }
    if (returnValue) {
        *returnValue = nil;
    }
    return _RSClosureInvokeWithNoReturn(closure);
}

RSTypeRef funcCB(RSTypeRef p1, RSTypeRef p2) {
    RSNumberRef n1 = (RSNumberRef)p1;
    RSNumberRef n2 = (RSNumberRef)p2;
    return RSNumberWithInteger(RSNumberCompare(n1, n2, nil));
}

void demo() {
    RSClosureGetTypeID();
    RSClosureRef closure = __RSClosureCreateInstance(RSAllocatorDefault);
    _RSClosureSetCallback(closure, funcCB);
    _RSClosureSetReturnType(closure, RSNumberGetTypeID());
    _RSClosureAddParam(closure, RSNumberWithInt(1));
    _RSClosureAddParam(closure, RSNumberWithInt(0));
    RSTypeRef compare = nil;
    _RSClosureInvoke(closure, &compare);
    if (compare && RSNumberIntValue(compare) == 0) {
        RSShow(RSSTR("equal"));
    } else if (compare && RSNumberIntValue(compare) == -1) {
        RSShow(RSSTR("less"));
    } else if (compare && RSNumberIntValue(compare) == 1) {
        RSShow(RSSTR("greater"));
    } else if (!compare) {
        RSShow(RSSTR("closure has too many variable bindings!"));
    } else {
        RSShow(RSSTR("unknown"));
    }
    RSRelease(closure);
}